// ProductCard.tsx
import React from "react";
import { FeaturedMarket } from "../../types/types";

interface ProductCardProps {
  product: FeaturedMarket;
}

const ProductCard: React.FC<ProductCardProps> = ({ product }) => {
  return (
    <div className="product-card">
      <img src={product.images[0].desktop} alt={product.title} />
      <h3>{product.title}</h3>
      <p>{product.destination}</p>
      <p>{product.days} days</p>
      <p>Extra nights: {product.extraNights}</p>
      <p>Price: {product.priceDetail.fromPriceBeautify}</p>
      <button>View Details</button>
    </div>
  );
};

export default ProductCard;
